  `uuid` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `post_id` bigint(20) unsigned NOT NULL,
  `tracker_id` bigint(20) unsigned DEFAULT NULL,
  `link` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `short_code` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `thumbnail_url` text COLLATE utf8mb4_unicode_ci,
  `type` enum('image','video','sidecar','carousel') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'image',
  `caption` text COLLATE utf8mb4_unicode_ci,
  `caption_hashtags` text COLLATE utf8mb4_unicode_ci,
  `alttext` text COLLATE utf8mb4_unicode_ci,
  `likes` int(11) DEFAULT NULL,
  `comments` int(11) DEFAULT NULL,
  `engagement_rate` double(8,2) DEFAULT NULL,
  `emojis` int(11) DEFAULT NULL,
  `comments_positive` double DEFAULT NULL,
  `comments_neutral` double DEFAULT NULL,
  `comments_negative` double DEFAULT NULL,
  `comments_emojis` json DEFAULT NULL,
  `comments_hashtags` json DEFAULT NULL,
  `video_views` int(11) DEFAULT NULL,
  `video_duration` double DEFAULT NULL,
  `location_id` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `location` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `location_slug` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `location_json` json DEFAULT NULL,
  `published_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `comments_disabled` tinyint(1) NOT NULL DEFAULT '0',
  `caption_edited` tinyint(1) NOT NULL DEFAULT '0',
  `is_ad` tinyint(1) NOT NULL DEFAULT '0',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `influencer_posts_uuid_unique` (`uuid`),
  KEY `influencer_posts_influencer_id_foreign` (`influencer_id`),
  KEY `influencer_posts_tracker_id_foreign` (`tracker_id`),
  CONSTRAINT `influencer_posts_influencer_id_foreign` FOREIGN KEY (`influencer_id`) REFERENCES `influencers` (`id`) ON DELETE CASCADE,
  CONSTRAINT `influencer_posts_tracker_id_foreign` FOREIGN KEY (`tracker_id`) REFERENCES `trackers` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=129 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

